import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    container: {
        height: '100vh',
        width: '100%',
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-around',
        backgroundImage: 'linear-gradient(to bottom right, #fff, #D5E5F2)'
    },
    title: {
        textStrokeColor: '#2F4659',
        textFillColor: 'transparent',
        fontWeight: '600',
    },
    tabs: {
        backgroundColor: '#54728C',
    },

    '@media (min-width: 800px)': {
        container: {
            height: '100vh',
            width: '100%',
        },
        title: {
            fontSize: '10vw',
            textStrokeWidth: '3px',
        },
        tabs: {
            height: '40vh',
            width: '17vw',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'space-around',
            backgroundColor: '#54728C'
        },
        head: {
            fontSize: '1.5em',
            color: '#D5E5F2'
        },
        content: {
            fontSize: '1em',
            color: '#88A5BF'
        }
    },
    '@media (max-width: 800px)': {
        container: {
            height: '100vh',
            width: '100%',
        },
        title: {
            fontSize: '10vw',
            textStrokeWidth: '3px',
        },
        tabs: {

        },
        head: {

        },
        content: {

        }
    }
});


export default function LandingPage(props) {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            {/* <h1 className={classes.title}>What We Do</h1> */}
            <div className={classes.tabs}>
                <h2 className={classes.head}>Mechanical</h2>
                <p className={classes.content}></p>
            </div>
            <div className={classes.tabs}>
                <h2 className={classes.head}>Coding</h2>
                <p className={classes.content}></p>
            </div>
            <div className={classes.tabs}>
                <h2 className={classes.head}>Electronics</h2>
                <p className={classes.content}></p>
            </div>
            <div className={classes.tabs}>
                <h2 className={classes.head}>Science</h2>
                <p className={classes.content}></p>
            </div>
            <div className={classes.tabs}>
                <h2 className={classes.head}>Corporate</h2>
                <p className={classes.content}></p>
            </div>
        </div>
    );
};
